import styled from 'styled-components';

function App() {
  return <div style={{ display: "flex" }}>
    <div style={{ backgroundColor: "teal", width: 100, height: 100 }}></div>
    <div style={{ backgroundColor: "tomato", width: 100, height: 100 }}></div>
  </div>;
}

export default App;
